import IconColumn from './IconColumn.jsx'
import NavBar from './NavBar.jsx'
import WindowManager from './WindowManager.jsx';
import { useState } from 'react';

function PageManager() {
    const [openingDisplay, setOpeningDisplay] = useState(true);
    const [projectsDisplay, setProjectsDisplay] = useState(true);
    const [snakeDisplay, setSnakeDisplay] = useState(false);
    const [mineSweeperDisplay, setMineSweeperDisplay] = useState(false);
    const [the2048Display, setthe2048Display] = useState(false);
    const displays = [openingDisplay, projectsDisplay, snakeDisplay, mineSweeperDisplay, the2048Display];
    const setDisplays = [setOpeningDisplay, setProjectsDisplay, setSnakeDisplay, setMineSweeperDisplay, setthe2048Display];
    console.log(displays);

    return (
        <div class="flex flex-col h-screen w-screen bg-black font-mono">
            <NavBar />
            <div class="flex flex-row">
                <IconColumn displays={displays} setDisplays={setDisplays} />
                <WindowManager displays={displays} setDisplays={setDisplays} />
            </div>
        </div>
    )
}

export default PageManager;
